import React, { useState } from 'react'
import { FaInstagram } from 'react-icons/fa'
const Gallery = () => {
  const [selectedImage, setSelectedImage] = useState(null)
  const [modalOpen, setModalOpen] = useState(false)

  const images = [
    'https://i.ytimg.com/vi_webp/6ujB60TLEDI/sddefault.webp',
    'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS6y3QgUXh7-aszQspekE9AAEPKSd3-3cEbWCSXiKKuHWnDSd4yO64GjLrUYsIBD5MRUWc&usqp=CAU',
    'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS92_cwaUgQ_yD2bj43AVoLF6OCwt_SZ00Cy7TFH0IxClhcGfuHehC4KzvYNr2ZPWQZtC8&usqp=CAU',
    `data:image/jpeg;base64,`,
    'https://www.au-senegal.com/local/cache-gd2/42/12765256bb8592f1f3db6cdea2dc9a.jpg?1674918000',
    'https://static.wixstatic.com/media/18d353_aa0b6b282d4047169773a8a93ed078c9~mv2.jpg/v1/fill/w_361,h_395,al_c,lg_1,q_80,enc_auto/18d353_aa0b6b282d4047169773a8a93ed078c9~mv2.jpg',
    'https://upload.wikimedia.org/wikipedia/commons/e/e0/Diahaw-R%C3%A9sidence_du_roi_du_Sine_%28AOF%29_%283%29.jpg',
    'https://static.wixstatic.com/media/18d353_e41c0ac83bd14e9ab7ab5db02f4a5a0c~mv2.jpg/v1/crop/x_0,y_61,w_464,h_579/fill/w_520,h_642,al_c,lg_1,q_80,enc_auto/18d353_e41c0ac83bd14e9ab7ab5db02f4a5a0c~mv2.jpg',
    'data:image/jpeg;base64,',
    'https://www.senenews.com/wp-content/uploads/2020/12/img_20191130_180757_570-1.jpg',
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
  ]

  const openImage = (index) => {
    setSelectedImage(index)
    setModalOpen(true)
  }

  const closeImage = () => {
    setSelectedImage(null)
    setModalOpen(false)
  }

  const nextImage = () => {
    setSelectedImage((prevIndex) =>
      prevIndex === images.length - 1 ? 0 : prevIndex + 1
    )
  }

  const prevImage = () => {
    setSelectedImage((prevIndex) =>
      prevIndex === 0 ? images.length - 1 : prevIndex - 1
    )
  }

  return (
    <div className='follow'>
      
      <div className='follow-container'>
        {images.map((imageUrl, index) => (
          <article key={index} className={`f${index + 1}`}>
            <img
              src={imageUrl}
              alt=''
              onClick={() => openImage(index)}
              style={{ cursor: 'pointer' }}
            />
            
          </article>
        ))}
      </div>

      {modalOpen && (
        <div className='image-modal'>
          <div className='modal-content'>
            <div className='container-modal'>
              <img src={images[selectedImage]} alt='' className='modal-image' />
              
            </div>
            <div className='navigation'>
              <button onClick={prevImage}>Précédente</button>
              <button onClick={nextImage}>Suivante</button>
              <button onClick={closeImage}>Fermer</button>
            </div>
          </div>
        </div>
      )}
    </div>
  )
}

export default Gallery
